// SPDX-License-Identifier: MIT

pragma solidity 0.8.0;

contract A {

    function func1() public pure returns(string memory) {
        return "solidity";
    }
}

contract B {
    
    A public contract_a = new A();
    string public newName = contract_a.func1();
}

contract Trial {
    uint requiredAge;

    constructor(uint _requiredAge) {
        requiredAge = _requiredAge;
    }

        string public text = "sagar";

    function addLine(string memory added_text) public view returns(string memory) {
        return string(abi.encodePacked(text,added_text));
    }

    function checkAge(uint _age) public view {
        // require(_age > requiredAge, "Minimum age should be 20 years");
        require(_age > requiredAge, addLine("10"));
        /*
        // like below line.
        require(_age > requiredAge,"Minimum age should be ${requiredAge} years");
        */
    } 
}

